import React from 'react';
import { AntDesign } from '@expo/vector-icons';

const Home = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-white">
      <div className="flex flex-row items-center justify-center mb-12">
        <img
          src={require('../assets/westwood-logo.png')}
          alt="Westwood Logo"
          className="w-36 h-36 mr-5 object-contain"
        />
        <h1 className="text-2xl font-bold text-center">Westwood High School</h1>
      </div>
      <AntDesign name="arrowdown" size={24} color="black" className="absolute bottom-5" />
    </div>
  );
};

export default Home;
